import React from "react";
import { motion } from "framer-motion"
import './home.css';
import Glasses from '../../assets/Glasses';
import Disk from '../../assets/Disk';

interface HomeProp {
    darkMode: boolean;
}

export default function Home(props:HomeProp) {
    const {darkMode} = props;
    const [darkColor, lightColor] = ["#2A2B2A", "#FCF7FF"]


    return (
        <div className="home-container">
            <motion.div className="glasses-container">
                <Glasses animated={true} darkMode={props.darkMode}/>
            </motion.div>
            <Disk darkMode={darkMode} darkColor={darkColor} lightColor={lightColor} />
        </div> 
    )
};
